    Route,
    Switch,
    Link
} from 'react-router-dom';

class Header extends Component {
    render() {
        return (
            <div>
                        <nav >
                    <ul >
                        <li className="navBar">
                            <a className="Logo">DivGig</a>
                        </li>
                        <li className="navBar">
                            <a>Post Work</a>
                        </li>
